def min_jump(s):
    vowels = 'AEIOUY'
    n = len(s)
    dp = [0] * n
    dp[0] = 1
    for i in range(1, n):
        for j in range(i):
            if s[j] in vowels:
                dp[i] = max(dp[i], dp[j] + i - j)
    return dp[n - 1]

